import React from 'react';
import { connect } from 'react-redux';
import { headerAccepted } from '../actions';

class LocationMapPage extends React.Component {
    constructor(props) {
        super(props);
        this.props.headerAccepted(false);
    }

    render() {
        return (
            <div>mapka</div>
        );
    };
};

export default connect(null, { headerAccepted })(LocationMapPage);
